import './App.css';
import LandingPage from './components/LandingPage';
import Header from './components/LandingPages/Header';

function App() {
  return (
    <Router>
    <div>
      <Header />
      <div>
      <Routes>
        <Route path="/" element={<LandingPage />} />
      </Routes>
      </div>
    </div>
    </Router>
  );
}

export default App;
